import React, { Component } from 'react';

class Navigation extends Component{
  render(){
    return <ul>
      <li><a href="index.js">Navigation 1</a></li>
      <li><a href="index.js">Navigation 2</a></li>
      <li><a href="index.js">Navigation 3</a></li>
    </ul>;
  }
}

export default Navigation;
